import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Autoplay } from 'swiper';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/autoplay';

const AutoPlaySwiper = () => {
  return (
    <Swiper
      modules={[Navigation, Pagination, Autoplay]}
      spaceBetween={50}
      slidesPerView={1}
      autoplay={{
        delay: 2500,
        disableOnInteraction: false
      }}
      pagination={{ clickable: true }}
      navigation={true}
    >
      <SwiperSlide><img src="../../photos/Banner_top_1_1920x.jpeg" alt="Image 1" /></SwiperSlide>
      <SwiperSlide><img src="../../photos/Banner_top_2_1920x.jpeg" alt="Image 2" /></SwiperSlide>
      <SwiperSlide><img src="../../photos/Banner_top_3_1920x.jpeg" alt="Image 3" /></SwiperSlide>
      {/* Adicione mais slides conforme necess√°rio */}
    </Swiper>
  );
};

export default AutoPlaySwiper;
